import {Text, StyleSheet, View, TextInput} from "react-native";
import React from "react";

const styles = StyleSheet.create(
    {
        container: {
            display: 'flex',
            flexDirection: 'column',
            //backgroundColor: 'lightgrey',
            //flexWrap: 'wrap',
            width: '100%',
            padding: 16,
        },

        labels: {
            fontFamily: 'Roboto',
            fontSize: 18,
            width: 128,
            backgroundColor: 'teal',
            fontWeight: 'bold',
            padding: 8,
            marginBottom: 4,
            width: '100%',
        },

        items:{
            display: 'flex', 
            flexWrap: 'wrap',
            marginBottom: 16
        }


    }
)

export default class ReportTemplate extends React.Component {
    constructor(props){
        super(props);
        this.state ={
            title: "Relat√≥rio Mensal",
            month: '',
            hours: '',
            munutes: '',
            revisits: '',
            studies: '',
            publications: '',
            videos: ' ',
            remarks: ' '
        };
    }

    render(){
        return <View style={styles.container}>

            <Text style={{fontSize: 24}}>{this.state.title}</Text>
            <Text style={{borderColor: 'black'}} />
            
            <View style={styles.items}>
                <Text style={styles.labels}>
                    Tempo de servi√ßo
                </Text>
                <View style={{width}}>
                    <Text style={{
                        color: 'gray', 
                        fontWeight: 'bold',
                        fontSize: 18}}> Horas </Text>
                    <TextInput
                        style={{
                            backgroundColor: 'lightgray',

                        }}
                        placeholder="Horas de servi√ßo"
                    />
                </View>
            </View>

            <View style={styles.items}>
                <Text style={styles.labels}>
                    Minutos
                </Text>
                <TextInput
                    placeholder="Minutos de servi√ßo"
                />
            </View>

            <View style={styles.items}>
                <Text style={styles.labels}>
                    Revisitas
                </Text>
                <TextInput
                    placeholder="N√∫mero de revisitas"
                />
            </View>

            <View style={styles.items}>
                <Text style={styles.labels}>
                    Estudos
                </Text>
                <TextInput
                    placeholder="N√∫mero de estudos"
                />
            </View>
        </View>
    }
}
